import React from "react";
import { View, Text, Heading, Center, NativeBaseProvider,Stack, Container, Image } from "native-base";
import { SafeAreaView } from "react-native";




const AboutCinema = () => {
    return(
        <SafeAreaView bgColor={''} >
            <Center marginTop={'1/3'} >
                <Image size={'2xl'} source={require('../../resources/popi.gif')} alt="Loading" />
                <Text>Loading...</Text>
            </Center>
        </SafeAreaView>

    )
};

export default AboutCinema;
